package com.model2.mvc.common.test;
import org.jsoup.*;
import org.jsoup.nodes.Document;
import org.jsoup.nodes.Element;
import org.jsoup.select.Elements;

public class JsoupTest {

	public static void main(String[] args) {
		String targetString = "\r\n"
				+ "<p><img src=\"data:image/jpeg;base64,\" data-filename=\"pikapika.jpg\" style=\"width: 300px;\">dd</p><p><br></p><p>pika2</p><p><img src=\"data:image/jpeg;base64,\" data-filename=\"pikapika.jpg\" style=\"width: 300px;\"><br></p>";
		System.out.println(targetString);
		
		//문서 객체의 형태로 만든다.
		Document doc = Jsoup.parseBodyFragment(targetString);
		
		//img 태그의 Element들을 뽑아낸다.
		Elements images = doc.getElementsByTag("img");
		for(Element img : images) {
			System.out.println(img);
		}
		
	}

}
